// HashB calculates hash(b) and returns the resulting bytes.
func HashB(b []byte) []byte {
	hash := sha256.Sum256(b)
	return hash[:]
}

// HashH calculates hash(b) and returns the resulting bytes as a Hash.
func HashH(b []byte) Hash {
	return Hash(sha256.Sum256(b))
}

// DoubleHashB calculates hash(hash(b)) and returns the resulting bytes.
func DoubleHashB(b []byte) []byte {
	first := sha256.Sum256(b)
	second := sha256.Sum256(first[:])
	return second[:]
}

// DoubleHashH calculates hash(hash(b)) and returns the resulting bytes as a
// Hash.

func DoubleHashH(b []byte) Hash {
	first := sha256.Sum256(b)
	res := sha256.Sum256(first[:])
	hash := Hash{}
	hash.SetBytes(res[:])
	return hash
}

func hashCZZA(b []byte) []byte {
	hash := sha3.Sum512(b)
	for i := 0; i < 32; i++ {
		hash[i], hash[63-i] = hash[63-i], hash[i]
	}
	first := append(hash[:], hash[:]...)

	return append(first, first...)
}

func hashCZZB(in []byte, out []byte, tbl []byte, it byte) int {
	var cw = [256]byte{
		0, 0xe0, 0x1b, 0x02, 0xc9, 0xe0, 0x45, 0xee,
	}
	cw[0] = it
	var word [56]byte
	var data [256]byte
	i := 0
	for k := 0; k < 2048; k++ {

		var r, ki, kf byte
		hashKeySet(cw[:], word[:])
		copy(data[:], tbl[i:i+256])
		copy(cw[:], data[:])
		r = hashDec(word[:], data[:], in[:])
		ki = byte(k >> 3)
		kf = byte(k & 0x7)
		out[ki] |= r << kf
		i += 256
	}

	return 0
}

func hashXor8(b byte) byte {
	var r byte = 0
	for i := 0; i < 8; i++ {
		r ^= b & 0x1
		b >>= 1
	}

	return r
}

func hashCZZC(b []byte) []byte {
	hash := sha3.Sum256(b)
	//for i := 0; i < 16; i++ {
	//	hash[i], hash[31-i] = hash[31-i], hash[i]
	//}
	return hash[:]
}

func hashXor64(b []byte, a []byte) []byte {
	b[0] ^= a[0]
	b[1] ^= a[1]
	b[2] ^= a[2]
	b[3] ^= a[3]
	b[4] ^= a[4]
	b[5] ^= a[5]
	b[6] ^= a[6]
	b[7] ^= a[7]

	return b[:]
}

func keyPB(k uint64) uint64 {
	var n uint64 = 0
	for i := 0; i < 8; i++ {
		j := int(k & 0xFF)
		n |= kp[i][j]
		k >>= 8
	}
	return n
}

func hashKeySet(cw []byte, word []byte) int {
	var i, j int
	var key [7]uint64
	key[6] = binary.LittleEndian.Uint64(cw)
	for i = 6; i > 0; i-- {
		key[i-1] = keyPB(key[i])
	}
	for i = 0; i < 7; i++ {
		for j = 0; j < 8; j++ {
			word[i*8+j] = (byte)((key[i] >> uint(j*8)) ^ uint64(i))
		}
	}

	return 0
}

func BigToCompact(n *big.Int) uint32 {
	// No need to do any work if it's zero.
	if n.Sign() == 0 {
		return 0
	}

	// Since the base for the exponent is 256, the exponent can be treated
	// as the number of bytes.  So, shift the number right or left
	// accordingly.  This is equivalent to:
	// mantissa = mantissa / 256^(exponent-3)
	var mantissa uint32
	exponent := uint(len(n.Bytes()))
	if exponent <= 3 {
		mantissa = uint32(n.Bits()[0])
		mantissa <<= 8 * (3 - exponent)
	} else {
		// Use a copy to avoid modifying the caller's original number.
		tn := new(big.Int).Set(n)
		mantissa = uint32(tn.Rsh(tn, 8*(exponent-3)).Bits()[0])
	}

	// When the mantissa already has the sign bit set, the number is too
	// large to fit into the available 23-bits, so divide the number by 256
	// and increment the exponent accordingly.
	if mantissa&0x00800000 != 0 {
		mantissa >>= 8
		exponent++
	}

	// Pack the exponent, sign bit, and mantissa into an unsigned 32-bit
	// int and return it.
	compact := uint32(exponent<<24) | mantissa
	if n.Sign() < 0 {
		compact |= 0x00800000
	}
	return compact
}

func CompactToBig(compact uint32) *big.Int {
	// Extract the mantissa, sign bit, and exponent.
	mantissa := compact & 0x007fffff
	isNegative := compact&0x00800000 != 0
	exponent := uint(compact >> 24)

	// Since the base for the exponent is 256, the exponent can be treated
	// as the number of bytes to represent the full 256-bit number.  So,
	// treat the exponent as the number of bytes and shift the mantissa
	// right or left accordingly.  This is equivalent to:
	// N = mantissa * 256^(exponent-3)
	var bn *big.Int
	if exponent <= 3 {
		mantissa >>= 8 * (3 - exponent)
		bn = big.NewInt(int64(mantissa))
	} else {
		bn = big.NewInt(int64(mantissa))
		bn.Lsh(bn, 8*(exponent-3))
	}

	// Make it negative if the sign bit is set.
	if isNegative {
		bn = bn.Neg(bn)
	}

	return bn
}

