func hashDec(key []byte, data []byte, in []byte) byte {

	var r byte = 0

	hashWordDec(key, data[0:8])

	for i := 8; i < 256; i += 8 {
		hashXor64(data[i-8:i], data[i:i+8])
		hashWordDec(key, data[i:i+8])
	}

	for i := 0; i < 256; i++ {
		r ^= hashXor8(in[i] & data[i])
	}

	return r
}

// generate ensures that the dataset content is generated before use.
func getTBL() int {

	if czzTbl.bflag == 1 {
		return 0
	}
	file, err := os.Open("csatable.bin")
	if err != nil {
		fmt.Println(err)

	}
	defer file.Close()

	stats, statsErr := file.Stat()
	if statsErr != nil {

	}

	var size int64 = stats.Size()
	if size != TBLSize {
		fmt.Printf("file size is %d\n", size)
		return 1
	}

	bufr := bufio.NewReader(file)
	_, err = bufr.Read(czzTbl.data)

	czzTbl.bflag = 1

	return 0
}

func shift2048(in []byte, sf byte) []byte {
	out := make([]byte, 256)
	var sfI byte = sf >> 3
	var sfR byte = sf & 0x7
	var mask byte = (byte(1) << uint(sfR)) - 1
	var bits byte = (8 - sfR)
	var res byte
	if sfI > 0 {
		copy(out[0:], in[sfI:])
		id := int(256) - int(sfI)
		copy(out[id:], in[0:sfI])
	} else {
		copy(out[:], in[:])
	}

	res = (out[0] & mask) << uint(bits)
	for k := 0; k < 255; k++ {
		var val byte = (out[k+1] & mask) << uint(bits)
		out[k] = (out[k] >> uint(sfR)) + val
	}
	out[255] = (out[255] >> uint(sfR)) + res
	return out
}

func HashCZZ(header []byte, nonce uint64) []byte {
	var seed [64]byte

	err := getTBL()
	if err != 0 {
		fmt.Println("Init Table failed")
		return nil
	}
	val0 := uint32(nonce & 0xFFFFFFFF)
	val1 := uint32(nonce >> 32)

	for k := 3; k >= 0; k-- {
		seed[k] = byte(val0) & 0xFF
		val0 >>= 8
	}
	for k := 7; k >= 4; k-- {
		seed[k] = byte(val1) & 0xFF
		val1 >>= 8
	}

	for k := 0; k < 32; k++ {
		seed[k+8] = header[k]
	}
	first := hashCZZA(seed[:])
	first = append(first, first...)
	first = append(first, first...)
	for k := 0; k < 64; k++ {
		var second = [256]byte{0}
		it := byte(k/16)*16 + byte(first[255]>>4)
		sf := first[0] & 0x7F
		bs := int(it) * 524288
		tbl := czzTbl.data[bs:]

		hashCZZB(first, second[:], tbl, it)

		first = shift2048(second[:], sf)

	}
	for i := 0; i < 256; i += 4 {
		first[i], first[i+1], first[i+2], first[i+3] = first[i+3], first[i+2], first[i+1], first[i]
	}
	result := hashCZZC(first[:])
	return result[:]
}

